import styled from "styled-components";
import '../App.css';
import { Link } from 'react-router-dom';
import { Row, Col } from 'react-bootstrap';

const HeaderContainer = styled.div`
`

const Header = () => {
  return (
    <HeaderContainer>
      <Row>
        <Col sm={8}>
          <Link to='/SignIn'>Войти</Link>
        </Col>
        <Col sm={2}>
          <Link to='/SignIn'>Войти</Link>
        </Col>
        <Col sm={2}>
          <Link to='/SignIn'>Войти</Link>
        </Col>
      </Row>
    </HeaderContainer>
  );
}

export default Header;
